import React from 'react'
import "./TodoBox.css"

const todoBox = (props) => {
    return (
        <div className="TodoBox">
{props.show?(<h1>FIELDS</h1>):(
     <React.Fragment>
     <h4>Name: {props.name}</h4>
     <h4>Age: {props.age}</h4>
     <h4>Prof: {props.prof}</h4>
     </React.Fragment>
)}


            <button onClick={props.removeClicked} style={{margin:"1rem"}}>Click to Remove</button>
            <button onClick={props.editClicked} style={{margin:"1rem"}}>Click to Edit</button>

        </div>
    )
}

export default todoBox
